INSERT INTO `agrimin_client_interaction_report` (`id`, `client_id`, `interaction_date`, `location_interaction`, `phone_interaction`, `attendees_client_side`, `attendees_agrimin`, `purpose_of_meeting`, `sales_target`, `specific_issue`, `client_complant`, `summary_of_items_discussed`, `summary_of_action_points`, `summary_of_items_discussed_path`, `summary_of_action_points_path`, `purpose_of_meeting_achieved`, `action_tobe_taken_to_achieve_said_purpose`, `team_aci_followup_with_client`, `purpose_of_meeting_achieved_path`, `action_tobe_taken_to_achieve_said_purpose_path`, `team_aci_followup_with_client_path`, `entry_user_id`, `modify_user_id`, `entry_date`, `modify_date`, `is_active`, `full_name`, `job_title`, `mobile_prefix`, `mobile_office_number`, `email_address`, `alt_prefix`, `alternate_contact`, `user_comp_id`, `user_branch_id`) VALUES
(1, 97, '2020-01-24', NULL, NULL, 'Santhosh Kumar', 'Manoj Kewalramani', 'Seek Business in Palm oil export shipments ', 'Approx USD 40000 per annum', 'Nil', 'NIL ', 'MK was seeking appointment from Santhosh since past two months. Santhosh is senior trader involved in trading of oilseeds and proteins for almost 9 years in Cargill and then about 3 years in Palm oil trader under Olam. He has set up his own venture year ago and now quite active into FOB  shipments which also includes shipments to India ( MMTC).  There has been recently one shipment we attended where ARCIS was In string contract and it went quite well. MK introduced AgriMin profile. Santhosh was aware of Dr. Amin group in India during his Cargill days. \r\n\r\nPalm oil business was discussed in specific with capabilities we have , Santhosh expressed concern over shortages experienced in India and he was also of the opinion that shore tanks and foul intentions of some players causing situations to persist. \r\n\r\nMK offered him services in Indonesia , as we have done work for his team during Olam and Cargill, and feedback he had from our existing clients in Palm oil ( AgriMin), Santhosh quickly responded positive that he will definitely engage our services soon though his volume of shipments have reduced due to recent ban of refined oils imports by India, however in near future he is exploring more options to trade.\r\n\r\n', 'Manoj to follow up with him and submit proposal. Secure business on priority', NULL, NULL, 'Yes', 'Follow up to turn this meeting into business order', 'Constantly every week or two till we secure the first job.', NULL, NULL, NULL, 6, 6, '2020-01-24 08:40:18', '2020-01-24 08:40:18', 1, 'Santhosh Kumar', 'CEO', '0065', 92956268, 'santhosh@arcisgm.com', '', '', 23, 1),
(2, 104, '2020-02-28', 'on', NULL, 'Shankar Narayanan', 'Manoj Kewalramani', 'Introduce ACI ', 'Not determined', 'Nil', 'Nil', 'Shankar was informed about ACI / DACPL activities, different segments group is involved and our present involvement through Singapore office in the region.  \r\n\r\nAlzys Global is active player in trading of  Steel and affiliated raw materials , non ferrous minerals and metals , textiles. Shankar informed that they quite regular player for export of hard steel ( mainly coated coils ) to Latin American and West African markets.  He asked our ability to undertake quality and quantity inspections in China mainly exports from Tianjin ports.   Destination inspection not required. Presently all inspections done by SGS\r\n\r\nit was informed to him that presently we are in discussion to finalize our trade partner in China and soon will stay in touch with him on the capabilities, in the meantime I have requested him to provide scope of inspection and Testing requirements for us to discuss on capabilities with our potential partner', 'Manoj to stay in touch with Shankar to get the details of their inspection requirements', NULL, NULL, 'Yes', 'Coordinate with China to offer our services to Alzys ', 'In Mid March ', NULL, NULL, NULL, 6, 6, '2020-02-28 07:39:31', '2020-02-28 07:39:31', 1, 'Shankar Narayanan', 'Senior Vice President', '65', 97270886, 'shankar@alzys.sg', '', '', 23, 1),
(3, 108, '2020-03-10', 'on', NULL, 'Mohit Khandelwal', 'Manoj Kewalramani( MK)', 'Introduce ACI ', 'Not estimated', 'Nil', 'Nil', 'MK met Mohit over the lunch. Meeting requested in order to update Mohit about ACI group and its involvement in Minerals.  Seek their support in future inspection requirements especially in SEA / ISC region. Stemcor is actively involved in Scrap, Ferro alloys and other mineral commodities. They procure from various orgin, South America / Middle East / Africa and bring the cargo to South East Asia and ISC destination, more actively in Malaysia and India. MK requested for support in this area especially to start with us In India on trial basis to see how we perform on the ground. Mohit told me presently they use Geochem for past several years and it might take time , however he will try to see possibility to let  us in somewhere in Asian destination. He also told me that once we start on coal in Indonesia, he will extend his support to put in few words to his connections in mines and exports of coal to support us.', 'MK to send company profile to Mohit , covering minerals and test capabilities. ', NULL, NULL, 'Yes', 'Stay in touch with Mohit ', 'Once a month over the phone or coffee ', NULL, NULL, NULL, 6, 6, '2020-03-13 09:21:06', '2020-03-13 09:21:06', 1, 'Mohit Khandelwal', 'Trading Manager- Steel Raw Materials', '65', 91184778, 'Mohit.khandelwal@stemcor.com', '', '', 23, 1),
(4, 109, '2020-03-12', 'on', NULL, ' P.K. Jain', 'Manoj Kewalramani', 'Introduce ACI ', 'Not estimated', 'Nil', 'Nil', 'Valency International Trading Pte Ltd  is an international commodity trading house with its headquarters situated in Singapore. Most of the management is ex Swiss Singapore and MK has relationship since 20 years working for them starting with Cashew, fertilizers and pulses in the past. Group is actively involved in trading of Agro & Consumer Goods, Sulphur & Fertilizers, Steel & Scrap, and Others. \r\n\r\nMK explained to them on ACI profile, management in India and global team, current activities. PKJ started with positive comment that he knows that any work given to MK will be taken care of well basis experience and he is aware that DACPL is doing some financing CMA with their India office. PKJ told me that he will keep us in mind for any shipment out of Blacksea when anything comes up , but will definitely give us a chance to use our services in SEA and India. \r\n\r\nDuring the discussion he offered me to give rates for urea export inspections in Malaysia and assured that this business he can support us. He also told me to discuss with India management if we are keen to add capabilities in Cashew inspections then he can get us in there, as they are regular with cashew shipments to India, currently all buyers insist for RBS , local surveyor, however he can slowly get us in to the system.\r\n\r\nwith regard to steel, iron ore and other minerals , we could not talk in detail. MK recently met one of his senior management board member Mr. Pradeep Maheshwari, outside at public place  and briefed him about ACI,  during short talk Pradeep told me to meet in office in future to check how they can support ACI.', 'MK to arrange future meeting with Pradeep in due course. Presently aim is to enter into valency business somewhere , with initial focus on fertilizer.\r\n\r\nMK to check with SRA for any interest for us to get into cashew ', NULL, NULL, 'Yes ', 'send Proposal for Fertiliser inspection and liaise with client ', 'Within March to secure some share in Malaysia job if rates are acceptable ', NULL, NULL, NULL, 6, 6, '2020-03-13 09:49:54', '2020-03-13 09:49:54', 1, 'P.K. Jain', 'Managing Director ', '65', 91861517, 'pkj@valencyinternational.com', '', '', 23, 1),
(5, 136, '2021-02-22', NULL, NULL, 'Kandarp Bhalani', 'Manoj Kewalramani', 'Follow up', 'Not estimated', '', '', 'Meeting was one of those casual meeting we have time to time, this report is being prepared just to respect SRA request , though every meeting of such nature is more like continuing business relations and secure next vessel being our business more on spot nominations with no formal agreements of recurring nominations by default.\r\n\r\nKandarp was requested to advise experience his execution team had with us in first vessel m.t. Chang An 1 we did inspection for loading supervision at Indonesia during January. Kandarp is fully familiar with our reporting and follow up with my personal involvement in every whatsapp update to emails and he feels comfortable to call me for any small matter from cargo readiness to cargo quality , ship shore figures or feedback related to any other execution issues.  Being his execution team working with ACI first time ( though they have worked with same team in previous tenure), this feedback was important to us.\r\n\r\nHe mentioned that we are far better than SGS as so far they have been only using SGS and still annoyed but being no choice to Bangladesh buyer demand, they have to continue to give those ships to SGS, currently their 3rd vessel being loaded for Bangladesh and we were suppose to get all of them however buyer did not agree to AgriMin as updated earlier to SRA .\r\n\r\nKandarp told in my presence to his execution manager to give next small parcel they are selling to Riya, 1200 m.t. appointment to ACI, while writing this report, we already got this nomination.\r\n\r\nThis prompted me to check with Riya on not appointing us on this 17k boat as meeting with them happened last friday only and they never mentioned about it , on my request they mentioned that all sales they make to Emami , they appoint Amspec / Jasindo. I insisted that we do several vessels to Emami and as such no issues , further their top management has good relations with self and our India team for years. \r\n\r\nThis meeting with Kandarp was kind of help to push Riya too for considering us in their sales to Emami.\r\n\r\nKandarp continues his support in shipments to India. Manoj to ensure his execution builds up good confidence in our reporting and follow up ', 'Nil ', '', '', 'yes', 'yes', 'Keep in close contact with Olam ', '', '', '', 6, 6, '2021-02-23 05:55:56', '2021-02-23 05:55:56', 1, 'Kandarp Bhalani', 'General Manager- Edible Oils', '65', 96181402, 'kandarp.bhalani@olamnet.com', '', '', 23, 1),
(6, 140, '2021-02-27', 'on', NULL, 'Kate Goh and Darshna', 'Manoj Kewalramani', 'Discussion on existing business and explore more opportunities', '2 to 3 tanker load or discharge nominations a month', 'Nil', 'Nil', 'Discussion initiated with feedback on our first shipment attendance for them on palm oil discharge at India and then difficulties in appointing us due to rates found higher from Geneva on ukraine assignment forced them to use another agency due to short notice. \r\n\r\nLoading on Molasses shipment at Kandla where some rust particles were found by Master. Shipment attended by DACPL for Exporter however Sea Trek was looking for representation on thier behalf. Due to confilict of Interest attendance was offered only on another parcel but not the first parcel which has caused rust particle issue. Seatrek had to use another agency for the same.\r\n\r\nWe discussed on that matter where videos and pictures shared by DACPL shared with them , Darshna and Kate both were pleased that we remain responsive and prompt being weekend. \r\nour services on discharge supervision at South Korean ports were offered. Darshna told me since this issue happened at load port is now in hands of p and I club and they are taking care of surveyor appointment , they will let p and I appoint their surveyor in Korea too.\r\n\r\nShe told me that this vessel will repeat its voyage from Jaigarh ( loading A/c Peter Cremer) and will go to Philippines, they will evaluate need of surveyor and engage our services accordingly, presently two vessels are in long term charter for Palm and molasses traffic within South East asia.  Third vessel is mainly going to Europe under ICOF, LDC, Cargill etc and does not require any survey.\r\n\r\nThis is relatively new desk for them established in 2018 and now gradually going more into clean oil / palm products chartering , we also discussed about fixing attendance fee as routine surveyor for them basis per port, will follow up more on this as they asked me more details in specific to oil and grains presence, will write to them to get introduced to their bulk chartering desk too\r\n\r\n', 'Manoj to send profile summary of Group\'s experience in Liquids and Dry commodities to client for their consideration in such service requirements in their shipments.', NULL, NULL, 'Yes', 'Follow up on points above ', 'In March / April ', NULL, NULL, NULL, 6, 6, '2021-03-04 08:36:40', '2021-03-04 08:36:40', 1, 'Darshna R D', 'Senior Manager', '0065', 8132039, 'darshna@seatrek.com.sg', '', '', 23, 1),
(7, 141, '2021-03-03', 'on', NULL, 'Ashish Saurav and Priyadharsini', 'Manoj Kewalramani', 'Cotton and Cashew Nut business', 'Ongoing', 'Nil', 'Nil', 'Recently Deepak Agarwal has left Agrocorp. For all execution matters Priyadharsini has been focal point of contact. She has been a good supporter to us. MK was in touch with her for sparing time to catch up over a coffee or lunch and due to her twice a week schedule and Departure of Deepak kept her more occupied and it was finally planned. She invited Ashish also to join to meet me.  \r\n\r\nMK was briefly introduced to Ashish by Deepak during one of the office visit. Ashish informed that he has been with Glencore India taking care of cotton business under Manek for some time before joining Agrocorp 3 years ago and here was assisting Deepak.\r\n\r\nAshish and Priya both were approached to consider us in Bangladesh and India cotton business also.  Services of Baltic control our agent was offered giving brief comments on thier present involvment in Rice , Sugar and cotton for DACPL. Priya mentioned that they are very happy with services being given by Wakefiled for many years in Bangladesh however they will try to squeeze us in that to share some work. \r\n\r\nAshish mentioned that they would be also interested to share Raw Cashew nut ( RCN) imports in India and Vietnam business with us. They requested to provide some import data of Tuticorin and Manglaore ports having DACPL presence known to be wider, they expect us to give such support to them and check if we can offer services on  RCN import inspections.\r\n\r\nScope of inspection broadly covers site testing for moisture, count etc and carry out destuffing, weighing , tally kind of basic discharge supervision. MK have requested for specs and typical scope to discuss more on this with India and Vietnam', 'Follow up on Raw cotton data of Vietnam and Indonesia \r\nFollow up on RCN import data for indian ports \r\noffer services for inspection of RCN imports at India and Vietnam', NULL, NULL, 'Partly', 'Follow up on above points ', 'Continuous', NULL, NULL, NULL, 6, 6, '2021-03-04 09:05:38', '2021-03-04 09:05:38', 1, 'Ashish Saurav', 'Cotton Trader', '0065', 97120610, 'ashish.saurav@agrocorp.com.sg', '', '', 23, 1),
(8, 142, '2021-03-03', 'on', NULL, 'Sunil Patwari', 'Manoj Kewalramani', 'Explore Business opportunities', 'Not estimated', 'Nil', 'Nil', 'Sunil has been actively buying Rice and pulses from Myanmar, sugar and pulses trade with India and Ukraine. MK briefed him about ACI profile , he is familiar with DACPL quite well and have been working with DACPL team on sugar time to time.\r\n\r\nOn Ukraine Sunil was interested to hear about and assured me that in his pulses movement he will give us a chance and asked if i can execute well using ACI team ( whether its agent or ACI group etc) he was assured that work will be handled by ACI and follow up will be done through Singapore.  He also buys Sunflower oil in small volume where appointment is mainly handled by Delta Wilmar. DACPL and ACI involvement in Ukraine and India in SFO shipments was also discussed.\r\n\r\nSunil told me two interesting things which i did not know\r\n\r\n1) When i mentioned about our interest to set up in Myanmar , he told that he is using ICS  Thailand in his rice shipment from Myanmar, this was news to me as i did not know ICS operates in Myanmar too, Sunil was open to work with us in Myanmar, it is not his concern whom we use ( ICS or other provided that we do a good job) though he suggested that using ICS could be a good option. I told him that Siddharth knows Arun better than me, as i have lost touch with Arun \r\n\r\n2) we discussed on GPC events recently happened where he commented that DACPL is member of GPC, this was not known to me as well. if DACPL is member we can make use of that to participate in events for self as well ? need to check with Siddharth and also then approach players accordingly leveraging ACI\r\n\r\n', 'Siddharth to advise on above points and seek if we can work with Arun. His son Udomsek takes care of Myanmar ( his contact is +66817352720)', NULL, NULL, 'yes', 'Follow up with Sunil ', 'Stay in touch with Sunil ', NULL, NULL, NULL, 6, 6, '2021-03-04 09:35:20', '2021-03-04 09:35:20', 1, 'Sunil Patwari', 'Managing Director', '0065', 96276837, 'sunil.patwari@sopl.sg', '', '', 23, 1),
(9, 145, '2021-03-17', 'on', NULL, 'James Lee , Seow Hong Da, Lim Zhao Feng', 'Manoj Kewalramani', 'Introduce ACI ', 'Not estimated', 'Nil', 'Nil', 'Meeting was carried out on 8th March\r\n\r\nAgrifert is a member group company of Kuok Group , and are leading fertiliser player in the South East Asia Region. James and Hong Da are known to MK since they were operating as Liven where lot of support was rendered in fertiliser inspections.\r\n\r\nJames informed that their joint venture with AgriFert is due for renewal and he is quite occupied with board meetings however he shown courtesy to spend some time in board room to brief me about the group and heard my presentation on ACI briefly. He excused from meeting stating his two traders to discuss further with me and find ways to include ACI in the panel.\r\n\r\nThereafter discussion continued with Hong Da and Lim. They informed that as a group they are focussed fertiliser player for their own plants in the region as well as trading across south east / south asia and occassionally to Latin America, Egype. Major trade commodities are DAP / Urea and Ammonium Sulphate with last year turn over was close to 1.8 million tonnes.\r\n\r\nMK described our past experience and how ACI can play a role in protecting thier interest in load and discharge port. Various issues relating to discharge , product quality and shortages were discussed and MK gave them detailed note on how this can be better controlled and why such issues arises in our experience in different origin to destination. Hong Da was quite satisfied to hear and he assured to talk to Rana Chan ( GM operations) also well known to me , and suggested i should fix up one more meeting with Rana and work on proposal and service offering country wise. ', 'MK wrote to Rana Chan requesting meeting, she is avoiding meeting presently however will follow up during coming weeks to move things forward ', NULL, NULL, 'Yes', 'Follow up ', 'Already actioned. ', NULL, NULL, NULL, 6, 6, '2021-03-22 05:02:46', '2021-03-22 05:02:46', 1, 'James Y.H. Lee', 'Executive Director', '0065', 96157357, 'james.lee@agrifert-liven.com', '', '', 23, 1);
