(1, 0, NULL, 343, 'CH/2020/166', 'Single', '17-10-2020', NULL, 'Draft', '26-10-2020', 'MSM SUGAR REFINERY (JOHOR) SDN BHD\r\nPLO 46, JALAN IPIL 2,\r\nTANJUNG LANGSAT INDUSTRIAL COMPLEX,\r\nMUKIM SUNGAI TIRAM, 81700 PASIR GUDANG, \r\nJOHOR DARUL TAKZIM, MALAYSIA\r\n', 'CANAPOLIS ACUCAR E ETANOL SA', 'TO ORDER', 'BRAZILIAN CANE RAW SUGAR IN BULK', 'BRAZILIAN CANE RAW SUGAR IN BULK', NULL, 'LALIS D', '29565 MT', NULL, 'SANTOS, BRAZIL', 'TANJUNG LANGSAT, MALAYSIA', '', 'WEIGHT AND QUALITY CERTIFICATE - NO. 2020166-C', '', '', '', 'Open', 1, 1, 0, 1, 'TITLE', 'WE AGRIMIN CONTROL INTERNATIONAL S.A. BEING A RECOGNIZED INTERNATIONAL INDEPENDENT SUPERVISION COMPANY AND MEMBER OF GAFTA THROUGH OUR ASSOCIATES IN ARGENTINA,DO HEREBY CERTIFY HAVING SAMPLED THE ABOVE PARCEL AT TIME AND PLACE OF LOADING.', '', 1, 'SAMPLING AND ANALYSIS', 'DURING LOADING SAMPLES WERE DRAWN FROM LOADING BELT AT NEAREST PRACTICABLE POINT TO THE VESSEL AS PER GAFTA RECOMMENDATIONS AND A SET OF COMPOSITE SAMPLES WERE COMPOSED AND SEALED REPRESENTING THE TOTAL CARGO.ONE SEALED SAMPLE WAS FORWARDED TO AN INDEPENDENT GAFTA LABORATORY, REFLECTING THE FOLLOWING RESULTS.', '', 1, 'QUALITY', 'REPRESENTATIVE SAMPLES WERE DRAWN DURING LOADING OPERATIONS AND A COMPOSITE SAMPLES WAS SUBMITTED FOR ANALYSIS WITH THE FOLLOWING RESULTS,ALL FINAL AT THE MOMENT OF SHIPMENT.', '', 1, 'TITLE', 'PRIOR TO LOADING THE CARGO COMPARTMENTS MENTIONED ABOVE WERE VISUALLY INSPECTED AS FAR AS ACCESSIBLE/POSSIBLE FOR CLEANLINESS ONLY, AND FOUND EMPTY, DRY, CLEAN AND FREE FROM ABNORMAL ODOURS AND THEREFORE FOUND SUITABLE/FIT TO REVECEVIED AND CARRY THE ABOVE MENTIONED CARGO.', '<br><br><br><br><br><br>', 4, 0, '2020-12-22 09:27:12', '2020-10-26 10:57:19', 1, 25, 9, 2020),
